import './App.css';
import { CardList } from "./components/CardList";

function App() {
  return (
    <>
      <div className='header'>
        <input className='input' placeholder='Search your movie...' />
      </div>
      <div className='video'>
        <iframe width="420" height="315 "
          src="https://www.youtube.com/embed/tgbNymZ7vqY?autoplay=1&mute=1">
        </iframe>
      </div>
      <div className="App">
        <CardList />
      </div>
    </>

  );
}

export default App;
